using System;
using System.Collections.Generic;
using System.IO;
using System.Linq;
using System.Text;
using System.Threading.Tasks;

namespace SoundBlox
{
    public static class Sounds
    {
        public static string augh = "";
        public static string gahdam = "";
        public static string halflife = "";
        public static string minecraft = "";
        public static string oof = "";
        public static string vineboom = "";
        public static string yoda = "";

        public static void recreate(string dir)
        {
            byte[] augh_binaryData = Convert.FromBase64String(augh);
            File.WriteAllBytes(dir + @"\augh.ogg", augh_binaryData);
            byte[] gahdam_binaryData = Convert.FromBase64String(gahdam);
            File.WriteAllBytes(dir + @"\gahdam.ogg", gahdam_binaryData);
            byte[] halflife_binaryData = Convert.FromBase64String(halflife);
            File.WriteAllBytes(dir + @"\halflife.ogg", halflife_binaryData);
            byte[] minecraft_binaryData = Convert.FromBase64String(augh);
            File.WriteAllBytes(dir + @"\minecraft.ogg", minecraft_binaryData);
            byte[] oof_binaryData = Convert.FromBase64String(oof);
            File.WriteAllBytes(dir + @"\oof.ogg", oof_binaryData);
            byte[] vineboom_binaryData = Convert.FromBase64String(vineboom);
            File.WriteAllBytes(dir + @"\vineboom.ogg", vineboom_binaryData);
            byte[] yoda_binaryData = Convert.FromBase64String(yoda);
            File.WriteAllBytes(dir + @"\yoda.ogg", yoda_binaryData);
        }



    }
}
